    "# Offender Report (1980-2020)\n",
    "\n",
    "Question:  Do individuals in their late 40's and early 50's have abnormally high criminal histories?\n",
    "\n",
    "Study task: 1) Identify the years between 1980-2000 with the highest number of offenses committed; 2)Identify years during the time period with the highest number of offenses across different age groups, and 3) Identify number of arrests made during the same time period for violent crimes.\n",
    "\n",
    "\n",
    "Data produced for this report was downloaded from arrests records made available by The DOJ's Office of Juvenile Justice and Delinquency Prevention's Statistical Briefing Book.  Visit this [link](https://www.ojjdp.gov/ojstatbb/crime/ucr.asp?table_in=1) to access the data. \n",
    "\n",
    "The visuals that follow represent full and subset snapshots of arrests records for all ages from 1980 to 2020.\n",
    "\n",
    "## Visualizations\n",
    "\n",
    "### All offenses\n",
    "First, let's look at the big picture.  Below is a plot showing all offenses that resulted in arrests during the target time period."
