    "ggplot(NULL, aes(x = year, y = total_crime,fill=age_groups)) +\n",
    "  geom_point(data = violent_males_pivot2[violent_males_pivot2$age_groups %in% desired_levels2, ], col = \"blue\") +\n",
    "  geom_line(data = violent_males_pivot2[violent_males_pivot2$age_groups %in% desired_levels2, ], col = \"blue\") +\n",
    "  geom_point(data = violent_females_pivot2[violent_females_pivot2$age_groups %in% desired_levels2, ], col = \"red\") +\n",
    "  geom_line(data = violent_females_pivot2[violent_females_pivot2$age_groups %in% desired_levels2, ], col = \"red\") +\n",
    "  ggtitle(\"Violent Crime by Age Group (15+)\", subtitle = \"Males (blue) vs. Females (red)\") +\n",
    "  labs(x = \"Year\", y = \"Total Crime\") +\n",
    "  scale_y_continuous(labels = scales::comma) +\n",
    "  facet_wrap(~age_groups)"
   ]
