    "ggplot(year_age_crime) +\n",
    "  geom_col(mapping=aes(x=age_groups,y=total_crime,fill=as.factor(year))) +\n",
    "  ggtitle(\"Most Offenses by Age Group and Year\") +\n",
    "  labs(x = \"Age Groups\", y = \"Total Crime\") +\n",
    "  scale_fill_manual(name = \"Year\", values = c(\"green\", \"red\", \"black\",\"blue\")) +\n",
    "  scale_y_continuous(labels = scales::comma)"
   ]
