   "source": [
    "There may never be a direct correlation between the \"crack epidemic\" - that occurred during the mid 90's - and the fact that the highest number of all offenses and violent offenses were committed during that time period... but there is evidence to suspect it.\n",
    "\n",
    "## Recommendation\n",
    "\n",
    "To better understand why high concentrations of justice involved individuals can be found in this now middle aged group, the following books are recommended for study:\n",
    "* Freakonomics - Steven D. Levitt and Stephen J. Dubner\n",
    "* The Tipping Point - Malcolm Gladwell\n",
    "* The New Jim Crow - Michelle Alexander\n",
    "* Violent World, Peaceful Streets - David Kennedy\n",
    "* Lockdown America - Marc Mauer"
   ]
